import React from 'react';
import PropTypes from 'prop-types';
import Section from 'components/Section';

class Home extends React.Component {
    render() {
        const {
            data
        } = this.props;
        return (
            <div>
               {data.map((sections, index) => {
                   if (sections) {
                       return 'hola'
                   }
                   return 'no' 
               })}
            </div>
        );
    }
}

export default Home;
